    function darkSidemenu() {
      var arrayOfElements = content.shadowRoot.getElementById("users").shadowRoot.getElementById("sidemenu-content").getElementsByTagName('tc-userlist');
      var arrayOfUsers = document.getElementsByClassName('js-user-list-item'); // think you can delete
      var listItems = arrayOfElements[0].shadowRoot.getElementById("userlist").getElementsByClassName("list-item");
      setTimeout(function() {
        for (var ii = 0; ii < listItems.length; ii++) {
          var items = listItems[ii].getElementsByClassName("js-user-list-item");
          items[0].style.color = '#FFF';
          items[0].lastChild.setAttribute("data-gift", "0");
          items[0].lastChild.setAttribute("style", "background-color:#000000;");
        }
  
      }, 1000);
    }
  
    function lightSidemenu() {
      var arrayOfElements = content.shadowRoot.getElementById("users").shadowRoot.getElementById("sidemenu-content").getElementsByTagName('tc-userlist');
      var arrayOfUsers = document.getElementsByClassName('js-user-list-item');
  
      //gets userlist > list-item
      for (var i = 0; i < arrayOfElements.length; i++) {
        var listItems = arrayOfElements[i].shadowRoot.getElementById("userlist").getElementsByClassName("list-item");
  
        setTimeout(function() {
  
          for (var ii = 0; ii < listItems.length; ii++) {
            var items = listItems[ii].getElementsByClassName("js-user-list-item");
            items[0].style.color = '#000000';
            items[0].lastChild.setAttribute("data-gift", "0");
            items[0].lastChild.setAttribute("style", "background-color:#FFFFFF;");
          }
  
        }, 1000);
      }
    }
  
    function blacknavbar() {
      var navbar = document.getElementById("nav-static-wrapper");
      var sidemenu = content.shadowRoot.getElementById("users").shadowRoot.lastChild;
      //var modspans = content.shadowRoot.getElementById("users").shadowRoot.lastChild.childNodes[1].childNodes[4].shadowRoot.childNodes[1];
      navbar.setAttribute("style", "background-color: #000000; color: #FFFFFF;");
      sidemenu.setAttribute("style", "background-color: #000000; color: #FFFFFF;");
    }
  
    function whitenavbar() {
      var navbar = document.getElementById("nav-static-wrapper");
      var sidemenu = content.shadowRoot.getElementById("users").shadowRoot.lastChild;
      //var modspans = content.shadowRoot.getElementById("users").shadowRoot.lastChild.childNodes[1].childNodes[4].shadowRoot.childNodes[1];
      navbar.setAttribute("style", "background-color: #FFFFFF; color: #000000;");
      sidemenu.setAttribute("style", "background-color: #FFFFFF; color: #000000;");
    }
  
  
    function checkforfirstconnect(timing) {
      setTimeout(function() {
        doaction();
      }, timing);
  
      function doaction() {
        if (window.top.running === true) {
          console.log("oh we're running!!!!");
          return;
        } else {
          //console.log(window.top.running + " not exist");
        }
        var shadowroo = content.shadowRoot;
        if (typeof shadowroo != "undefined" && shadowroo !== null) { //must wait until shadowRoot exists, and below we wait until user > 0
          //console.log("DEFINEDDDD!!!!" + shadowroo);
          if (tcobject("usersbynickname").length > 0) {
            console.log("connected");
            firstconnect();
            return;
          } else {
            //console.log("NO USERS");
            setTimeout(function() {
              doaction();
            }, timing);
          } //no users so loop again
  
        } else {
          console.log("NOT DEFINED");
          setTimeout(function() {
            doaction();
          }, timing);
        } //no shadow root so loop again
      }
  
    }
  
  
  
    function hidemenuicon() {
      tcobject("menuicon").style.display = "none";
      tcobject("usersicon").style.top = "10px";
    }
  
    function hidelivedirectorybutton() {
      tcobject("livedirectorybutton").style.display = "none"; //hide "Live directory" button.
    }
  
    function manualdarktoggleon() {
      tcobject("videolist").style.backgroundColor = "black";
      tcobject("headerbuttons").style.backgroundColor = "black";
      tcobject("chatwrapper").style.backgroundColor = "black";
    }
  
    function replacesettingsbutton() {
      var span = document.createElement("span");
      var svg = document.createElement("svg");
      svg = tcobject("settingsspan").firstChild.cloneNode(true);
      svg.setAttribute("width", "24");
      svg.setAttribute("height", "24");
      //svg.height = "24";
      //svg.viewBox = "0 0 20 20";
      svg.addEventListener("click", function() {
        console.log("clicked");
        eventFire(tcobject("settingsspan"), 'click');
      });
      span.appendChild(svg);
      tcobject("headerbuttons").appendChild(span);
      function eventFire(el, etype) {
        if (el.fireEvent) {
          el.fireEvent('on' + etype);
        } else {
          var evObj = document.createEvent('Events');
          evObj.initEvent(etype, true, false);
          el.dispatchEvent(evObj);
        }
      }
  
    }
  
