    function darkmodetoggle(what) {
      if (typeof window.darkmode === "undefined") {
        window.darkmode = "on";
      } else {
        if (window.darkmode == "off") {
          window.darkmode = "on";
        } else if (window.darkmode == "on") {
          window.darkmode = "off";
        }
      }
  
      function dothing() {
        if (window.darkmode == "on") {
          makedark();
        }
        if (window.darkmode == "off") {
          makelight();
        }
      }
  
      dothing();
  
      window.addEventListener("resize", function() {
        setTimeout(function() {
          dothing();
        }, 10);
        setTimeout(function() {
          dothing();
        }, 350);
      }, false); //after exiting fullscreen, it can reset, 10ms for chrome, 350ms for firefox, to re-darken it.
  
  
      function blackbackground() {
        var videobackground = content.shadowRoot.getElementById("room-content").childNodes[0].shadowRoot.getElementById("videolist");
        var videocontent = content.shadowRoot.getElementById("room-content").childNodes[0].shadowRoot.getElementById("videos-content");
        var videoheader = content.shadowRoot.getElementById("room-content").childNodes[0].shadowRoot.getElementById("videos-header");
        videoheader.setAttribute("style", "background-color: #000000;");
        videobackground.setAttribute("style", "background-color: #000000;");
        videocontent.setAttribute("style", "background-color: #000000;");
  
        //UsersIcon
        var svg = document.getElementById("users-icon").getElementsByTagName("svg")[0].innerHTML;
        svg = svg.replace('fill="#000"', 'fill="#fff"'); //black icon
        svg = svg.replace('stroke="#fff"', 'stroke="#000"'); //white trim
        document.getElementById("users-icon").getElementsByTagName("svg")[0].innerHTML = svg;
      }
  
      function whitebackground() {
        var videobackground = content.shadowRoot.getElementById("room-content").childNodes[0].shadowRoot.getElementById("videolist");
        var videocontent = content.shadowRoot.getElementById("room-content").childNodes[0].shadowRoot.getElementById("videos-content");
        var videoheader = content.shadowRoot.getElementById("room-content").childNodes[0].shadowRoot.getElementById("videos-header");
        videoheader.setAttribute("style", "background-color: #FFFFFF;");
        videobackground.setAttribute("style", "background-color: #FFFFFF;");
        videocontent.setAttribute("style", "background-color: #FFFFFF;");
  
        // UsersIcon
        var svg = document.getElementById("users-icon").getElementsByTagName("svg")[0].innerHTML;
        svg = svg.replace('fill="#fff"', 'fill="#000"'); //black icon
        svg = svg.replace('stroke="#000"', 'stroke="#fff"'); //white trim
        document.getElementById("users-icon").getElementsByTagName("svg")[0].innerHTML = svg;
      }
  
      function makedark() {
        darkSidemenu();
        blacknavbar();
        blackbackground();
        tcobject("chatwrapper").classList.add("full-screen");
        tcobject("videolist").classList.add("full-screen");
        content.style.backgroundColor = "hsl(0,0%,0%)";
        document.body.classList.add("darkmode");
        document.body.classList.remove("lightmode");
      }
  
      function makelight() {
        lightSidemenu();
        whitenavbar();
        whitebackground();
        tcobject("chatwrapper").classList.remove("full-screen");
        tcobject("videolist").classList.remove("full-screen");
        content.style.backgroundColor = "hsl(203,11%,100%)";
        document.body.classList.remove("darkmode");
        document.body.classList.add("lightmode");
      }
  
    }
  
    function flashfordms(timing) {
      var originaltitle = document.title;
  
      function flashdmstyleadd() {
        var styler = document.createElement("style");
        styler.innerHTML = "@keyframes flash {to {filter: opacity(0)}}";
        tcobject("usersicon").appendChild(styler);
      }
      flashdmstyleadd();
  
      setInterval(function() {
        doaction();
      }, timing);
  
      function doaction() {
        var pms = tcobject("directmsgs");
        var greenroomcount = tcobject("greenroom").getAttribute("data-videos-count");
        var i;
        var unreadpm = null;
        for (i = 0; i < pms.length; i++) {
          if (pms[i].getAttribute("data-messages") > 0) {
            unreadpm = pms[i].parentNode.childNodes[1].textContent;
          }
        }
        if (unreadpm !== null) {
          document.title = "PM from " + unreadpm + "!";
          setTimeout(function() {
            document.title = originaltitle;
          }, timing / 2);
          tcobject("usersicon").style.animation = "";
        } else {
          if (greenroomcount > 0) {
            document.title = "Greenroom has pending cams";
            setTimeout(function() {
              document.title = originaltitle;
            }, timing / 2);
            tcobject("usersicon").style.animation = "";
          } else {
            tcobject("usersicon").style.animation = "";
          }
        }
      }
    }
  
    function keeplistcollapsed() {
  
      doaction();
      window.addEventListener("resize", function() {
        setTimeout(function() {
          doaction();
        }, 10);
        setTimeout(function() {
          doaction();
        }, 350);
      }, false);
  
      function doaction() {
        document.body.classList.add("full-screen");
        tcobject("usersicon").style.visibility = "visibile";
        tcobject("usersicon").style.opacity = "1";
        tcobject("sidemenu").classList.add("full-screen");
        tcobject("room").classList.add("full-screen");
      }
    }
  
    function hidedescriptionbar() {
      hideit();
      window.addEventListener("resize", function() {
        setTimeout(function() {
          hideit();
        }, 10);
        setTimeout(function() {
          hideit();
        }, 350);
      }, false);
  
      function hideit() {
        tcobject("descriptionbar").style.display = "none";
      }
    }
  
    function allowfullscreenbutton() {
  
      function togglefullscreen() {
  
        function findmethod() {
          if (document.fullscreenEnabled) {
            return "w3";
          }
          if (document.webkitFullscreenEnabled) {
            return "webkit";
          }
          if (document.mozFullScreenEnabled) {
            return "moz";
          }
        }
  
        var method = findmethod();
        var target = document.querySelector("html");
  
        function alreadyfullscreen() {
          if (method == "moz" && document.mozFullScreenElement != null) {
            return true;
          }
          if (method == "w3" && document.fullscreenElement != null) {
            return true;
          }
          if (method == "webkit" && document.webkitFullscreenElement != null) {
            return true;
          }
        }
  
        function enterfullscreen() {
          if (method == "moz") {
            target.mozRequestFullScreen();
          }
          if (method == "w3") {
            target.requestFullscreen();
          }
          if (method == "webkit") {
            target.webkitRequestFullscreen();
          }
        }
  
        function exitfullscreen() {
          if (method == "moz") {
            document.mozCancelFullScreen();
          }
          if (method == "w3") {
            document.exitFullscreen();
          }
          if (method == "webkit") {
            document.webkitExitFullscreen();
          }
        }
  
        if (alreadyfullscreen()) {
          exitfullscreen();
  
        } else {
          enterfullscreen();
        }
  
      }
  
      function eventFire(el, etype) {
        if (el.fireEvent) {
          el.fireEvent('on' + etype);
        } else {
          var evObj = document.createEvent('Events');
          evObj.initEvent(etype, true, false);
          el.dispatchEvent(evObj);
        }
      }
  
  
      tcobject("enterfullscreenSVG").addEventListener("click", function() {
        togglefullscreen();
        eventFire(tcobject("modalclosebutton"), 'click');
  
      });
  
      tcobject("exitfullscreenSVG").addEventListener("click", function() {
        togglefullscreen();
        eventFire(tcobject("modalclosebutton"), 'click');
      });
  
    }
  
